import React from 'react';

const SupplierFinder = () => {
  return (
    <section className="bg-[#E8FBFF] py-10 flex justify-around mt-16 text-center">
      <h2 className="text-2xl font-bold mb-4">Let Suppliers Find You</h2>
      <button type="button" className='bg-[#EB7150] w-60'>Get Varified</button>
    </section>
  );
};

export default SupplierFinder;
